import React, { Component } from 'react';
import { Box, Button, Dialog, DialogContent, DialogTitle, DialogContentText, TextField, DialogActions } from '@material-ui/core';
import {makeStyles} from '@material-ui/core/styles';

interface ISignInButtonState 
{
    open: boolean
}
interface ISignInButtonProps 
{
    classes: Record<"title", string>
}

const useStyles = makeStyles((theme: any) => ({
    title: {
        justifyContent: 'center',
        alignItems: 'center',
        alignContent: 'center',
        alignSelf: "center"
    }
}));

class SignInButton extends Component<ISignInButtonProps, ISignInButtonState> {

    constructor(props: ISignInButtonProps)
    {
        super(props);

        this.state = {
            open: false
        }

        this.handleClickOpen = this.handleClickOpen.bind(this);
        this.handleClose = this.handleClose.bind(this);
    }

    handleClickOpen() : void
    {
        this.setState((previousState, props) => ({
            open: true
        }))
    }

    handleClose() : void
    {
        this.setState((previousState, props) => ({
            open:false
        }));
    }
    
    render() {
        return (
            <Box mr={3}>
                <Button color="inherit" variant="outlined" onClick={this.handleClickOpen}>
                    Sign in
                </Button>
                <Dialog open={this.state.open} onClose={this.handleClose} arial-lablledby="form-dialog-title">
                    <DialogTitle id="form-dialog-title" className={this.props.classes.title}>
                        Sign In
                    </DialogTitle>
                    <DialogContent>
                        <DialogContentText>
                            Please, fill fields to sign in
                        </DialogContentText>
                        <TextField 
                        autoFocus
                        margin="dense"
                        id="login"
                        label="Email"
                        type="email"
                        fullWidth
                        />
                        <TextField 
                        margin="dense"
                        id="password"
                        label="Password"
                        type="password"
                        fullWidth
                        />
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={this.handleClose} color="primary">
                            Cancel
                        </Button>
                        <Button onClick={this.handleClose} color="primary">
                            Sign in
                        </Button>
                    </DialogActions>
                </Dialog>
            </Box>
        );
    };
}

export default () => {
    const classes = useStyles();
    return <SignInButton classes={classes} />;
};
